import React from "react";
import HeroVid from "../../assets/trafic.mp4";
import "./homeStyle.css";

export default function Home() {

    return (
        <div>
            <div id="header">

            </div>

            <div id="heroSection">
                <div id="heroFlex">
                    <div id="heroArea">

                    </div>
                </div>
                <div id="heroTextFlex">
                    <div id="heroText">

                    </div>
                </div>
                <video id="heroVid" autoPlay muted loop>
                    <source src={HeroVid} type="video/mp4" />
                </video>
            </div>

            <div id="section1">

            </div>
        </div>
    );
}
